import './App.css';
import Hero from './components/Hero';
import Navbar from './components/Navbar';

const App = () => {
	return (
		<div className="App">
			<Navbar />
			<header className="App-header">
			<div>
				<Hero />
			</div>
			</header>
		</div>
	);
}

export default App;
